import axios from "axios";

const userSignUp = async () => {
    axios({
        url: "https://desktop-app-production.up.railway.app/signup",
    })
        .then((res) => {
            console.log(res);
        })
        .catch((err) => {
            console.error(err);
        })
}

export default userSignUp;
